pattern_map::pattern_map() {
	for(auto op : openings)
	{
		insert_state(op);
	}
}

void pattern_map::insert_state(const Board& board) {
    insert_state(board.to_ll());
}

void pattern_map::insert_state(uint64_t board) {
    states.insert(board);
}

auto pattern_map::contains(const Board& board) const -> bool {
    uint64_t hashed = board.to_ll();

    return states.contains(hashed);
}
